import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import GeneralAptitude from "./pages/GeneralAptitude";
import Interview from "./pages/Interview";
import Engineering from "./pages/Engineering";
import Programming from "./pages/Programming";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import "./styles/Home.css";
import "./styles/Navbar.css";
import "./styles/Sidebar.css";
import "./styles/GeneralAptitude.css";
import "./styles/Interview.css";
import "./styles/Engineering.css";
import "./styles/Programming.css";


const Arithmetic = () => <div className="p-6">‚ûó Arithmetic Aptitude</div>;
const DataInterpretation = () => <div className="p-6">üìä Data Interpretation</div>;
const VerbalAbility = () => <div className="p-6">üó£Ô∏è Verbal Ability</div>;

const App = () => {
  return (
    <Router>
      <div className="flex">
        <Navbar />
        <div className="ml-64 p-6 w-full">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/arithmetic" element={<Arithmetic />} />
            <Route path="/data-interpretation" element={<DataInterpretation />} />
            <Route path="/verbal-ability" element={<VerbalAbility />} />
            {/* Add more routes here */}
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
